        text-shadow: -2px -2px 0 black;

            1px 1px 0 red;  */

            1px 1px 0 #000;

        font-size: 24px;
        transform: rotate(145deg);
        transform-origin: center;

    }

        color: black;
        font-size: 9pt;
        font-weight: bold;
    }
